import React from "react";
import AuthService from "../services/auth.service";
import { useParams } from "react-router-dom";
import image from "../Images/home.jpeg"
import "../components/Member/Member.css"
const Profile = () => {
  const currentManager = AuthService.getCurrentManager();
  console.log(currentManager);
  // console.log(useParams);

  return (
    <div>
      <img src={image} id="imgt2" />
      <div className="card profile">
        <h3 class="prof" align="left">Branch Name: {currentManager.branch.Branch_Name}</h3>
        <h3 class="prof">Branch Location: {currentManager.branch.Branch_Location}</h3>
        <h3 class="prof">Branch Email: {currentManager.branch.Branch_Email}</h3>
        <h3 class="prof">Phone Number: {currentManager.branch.Branch_Phone_Number}</h3>
        <h3 class="prof">Manager ID: {currentManager.branch.Manager_ID}</h3>
        <h3 class="prof">Manager Name: {currentManager.branch.Manager_Name}</h3>
        <h3 class="prof">Manager Email: {currentManager.branch.Manager_Email}</h3>
      </div>
    </div>
  );
};

export default Profile;
